def angle_RAD(a):
    if builtins.ANGLEMODE == DEGREES:
        return a * math.pi/180
    else:
        return a    

def angle_DEG(a):
    if builtins.ANGLEMODE == RADIANS:
        return int(a * 180 / math.pi)
    else:
        return int(a) 

# SHAPE
def cxy(xx,yy):   # transform x,y coordinate
    global settings
    a  = settings["rotate_amnt"]
    s  = settings["scale_amnt"]
    ox = settings["real_ox"]
    oy = settings["real_oy"]
    x = xx
    y = yy
    if a > 0 :
        aa = angle_RAD(a)
        x = int(xx * math.cos(aa)) - int(yy * math.sin(aa))
        y = int(yy * math.cos(aa)) + int(xx * math.sin(aa))
    if s != 1 :
        x = x * s
        y = y * s
    if (ox != 0) or (oy != 0):
        x = x + ox
        y = y + oy     
    return (x, y)
    pass

def ctxy(c):    # transform tuple x,y coordinate
    tmp = []
    for i in range(len(c)):
        tmp.append(cxy(c[i][0],c[i][1]))
    return tmp  



# ---- 2D PRIMITIVES ----
def arc(x, y, w, h, start, stop, mode = ARC):              
    emode = builtins.ellipse_mode
    if emode == RADIUS:
        w = 2 * w
        h = 2 * h
    if emode == CORNER:
        x = x + w/2
        y = y + h/2
    if emode == CORNERS:
        w = abs(w - x)
        h = abs(h - y)
        x = x + w/2
        y = y + h/2     
    draw_arc(CAIRO_SURFACE, x, y, w, h, angle_RAD(start), angle_RAD(stop), mode)    
    pass

def ellipse(x, y, w, h=None):    
    if not h:
        h = w
    emode = builtins.ellipse_mode
    if emode == RADIUS:
        w = 2 * w
        h = 2 * h
    if emode == CORNER:
        x = x + w/2
        y = y + h/2
    if emode == CORNERS:
        w = abs(w - x)
        h = abs(h - y)
        x = x + w/2
        y = y + h/2          
    draw_ellipse(CAIRO_SURFACE, x, y, w, h)
    pass

def circle(x, y, d):
    emode = builtins.ellipse_mode
    w = d
    if emode == RADIUS:
        d = 2 * d
    if emode == CORNER:
        x = x + d/2
        y = y + d/2
    if emode == CORNERS:
        x1 = d
        y1 = d
        w = abs(x - x1)
        h = abs(y - y1)
        x = x1 + w/2
        y = y1 + h/2     
    draw_circle(CAIRO_SURFACE, x, y, w/2)   
    pass

def line(x1, y1, x2, y2):  
    draw_line(CAIRO_SURFACE, x1, y1, x2, y2)
    pass

def point(x, y):
    emode = builtins.ellipse_mode
    builtins.ellipse_mode = CENTER
    draw_circle(CAIRO_SURFACE, x, y, settings["stroke_weight"])
    builtins.ellipse_mode = emode  
    pass

def quad(x1, y1, x2, y2, x3, y3, x4, y4):
    vertices =[(x1, y1), (x2, y2), (x3, y3), (x4, y4)]
    draw_polygon(CAIRO_SURFACE, vertices)
    pass

def rect(x, y, w, h):
    rmode = builtins.rect_mode
    if rmode == RADIUS:
        w = 2 * w
        h = 2 * h
    if rmode == CENTER:
        x = x - w/2
        y = y - h/2
    if rmode == CORNERS:
        w = abs(w - x)
        h = abs(h - y)    
    draw_rect(CAIRO_SURFACE, x, y, w, h)     
    pass

def square(x, y, s):
    rect(x, y, s, s)
    pass

def triangle(x1, y1, x2, y2, x3, y3):
    vertices =[(x1, y1), (x2, y2), (x3, y3)]
    draw_polygon(CAIRO_SURFACE, vertices)
    pass

# ---- VERTEX ----
   
def beginShape():
    global shape, vertices, curvevertices
    shape = True
    vertices.clear()
    curvevertices.clear()
    pass

def vertex(x,y):
    global shape, vertices
    if shape:
        vertices.append((x,y))
    pass

def curveVertex(x,y):
    global shape, curvevertices
    if shape:
        curvevertices.append((x,y))
    pass    

def bezierVertex(*args):
    global shape, beziervertices
    if shape:
        if len(args) == 6:
            beziervertices.append(args)   
    pass  

    
def endShape(*args): # draw polygon/lines or spline curve
    global shape, vertices,curvevertices
    if len(args)==1 :
        if args[0] == "close":   
            if len(vertices) > 0:
                draw_polygon(CAIRO_SURFACE, vertices)
            if len(curvevertices) > 0:            
                draw_spline(CAIRO_SURFACE, curvevertices,True)
            if len(beziervertices) > 0:
                if len(vertices) == 1:              
                    draw_bezier(CAIRO_SURFACE, vertices[0], beziervertices, True)
    else:
        if len(vertices) > 0:            
                draw_lines(CAIRO_SURFACE, vertices)
        if len(curvevertices) > 0:            
                draw_spline(CAIRO_SURFACE, curvevertices,False)
        if len(beziervertices) > 0:
            if len(vertices) == 1:              
                draw_bezier(CAIRO_SURFACE, vertices[0][0], vertices[0][1], beziervertices, False)
    shape = None
    vertices.clear()
    curvevertices.clear()
    beziervertices.clear()
    pass   

def curve(*args):
    curvvert =[]
    if len(args) > 0:
        for i in range(0,len(args)-1,2):
            curvvert.append((args[i],args[i+1]))
        curvevertices.append(curvvert[0])
        for i in range(len(curvvert)):
            curvevertices.append(curvvert[i])
        curvevertices.append(curvvert[len(curvvert)-1])
        if len(curvevertices) > 0:            
                    draw_spline(CAIRO_SURFACE, curvevertices,False)      
        curvevertices.clear()

def bezier(*args):
    bz = []
    if len(args) == 8:
        for i in range(2,8):
            bz.append(args[i])
        draw_bezier(CAIRO_SURFACE, args[0], args[1], [bz], False)
        
    
# ---- TYPOGRAPHY ---

def text(txt, x, y):
    style = "normal"
    if settings["text_italic"]:
        style = "italic"
    if settings["text_bold"]:
        style = "bold"
    if settings["text_bold"] and settings["text_italic"]:
        style = "bolditalic"       
    draw_text(CAIRO_SURFACE, txt, x, y, style)

def textStyle(style):
    if style == "bold":
           settings["text_bold"] = True 
    if style == "italic":
           settings["text_italic"] = True 
    if style == "bolditalic":
           settings["text_bold"] = True
           settings["text_italic"] = True 
    if style == "normal":
           settings["text_bold"] = False 
           settings["text_italic"] = False
    pass
        
def textSize(size: int): # Sets the current font size
    settings["text_size"] = size
    pass
    
def textFont(font, size=None): # Set current text font.
    settings["text_font"] = font 
    settings["text_size"] = size
    pass

def textAlign(align):
    if align in [CENTER,LEFT,RIGHT]:
        settings["text_align"] = align
    else:
        raise ValueError("textAlign() was expecting LEFT|CENTER|RIGHT")
      
# ---- IMAGE AND PIXEL ----
def bgra_surf_to_rgba_string(surface):
    # convert raw data from BGRA to RGBA
    img = surface.get_data()
    rgba= img
    for i in range(0,len(rgba),4):
               rgba[i],rgba[i+2]=rgba[i+2],rgba[i]
    return rgba
    
def loadImage(path): # load image to IMAGE_SURFACE
    img_surface = cairo.ImageSurface.create_from_png(path)
    rgba= bgra_surf_to_rgba_string(img_surface)
    return img_surface

def image(image, x, y):
    ctx = cairo.Context(CAIRO_SURFACE)
    ctx.set_source_surface(image, x, y)    
    ctx.paint()
     
def saveCanvas(filename):        
    pygame.image.save(pg_Screen, filename)

def loadPixels():
    surface = CAIRO_SURFACE
    img = surface.get_data()
    rgba= img
    for i in range(0,len(rgba),4):
               rgba[i],rgba[i+2]=rgba[i+2],rgba[i]
    builtins.pixels = list(rgba)
   
def updatePixels():
    rgba= builtins.pixels
    for i in range(0,len(rgba),4):
               rgba[i],rgba[i+2]=rgba[i+2],rgba[i]
    img = bytearray(rgba)
    img_surface = cairo.ImageSurface.create_for_data(img, cairo.FORMAT_ARGB32, builtins.width, builtins.height)
    ctx = cairo.Context(CAIRO_SURFACE)
    ctx.set_source_surface(img_surface, 0, 0)    
    ctx.paint()

